import { useNavigate } from 'react-router-dom'

export default function Contactus() {
    const navigate = useNavigate();

    const disclaimClick = () => {
        navigate('./Disclaimer.jsx');
    };

    const developerClick = () => {
        navigate('./Developer.jsx');
    };

    const faqClick = () => {
        navigate('./Faq.jsx');
    };

    return (
        <div className="contactus">
            <button className = "dropdown-button" > Contact fi$pond </button>
                <div className="dropd">
                    <a href="" target="_blank" rel="norefererr"><button onClick={disclaimClick}>Disclaimer</button></a>
                    <a href="" target="_blank" rel="norefererr">Developer?</a>
                    <a href="" target="_blank" rel="norefererr">Customer Service</a>
                </div>
        </div>
    );
}
